



    function alignCenter(elem) {
    elem.css({
        left: ($(window).width() - elem.width()-40) / 2  + 'px',
        top: 10  + '%'
    })
}

    function maxId(myArray,str) {

    max = 0;

    myArray.filter(function(item, index){
    if (item.delete_ceiling != 'true'){
    if((item.id)-0 >= max){
    return  max = item.id
}
}
})

    return max

}

