    function getAjax(item){

    jQuery.ajax({
        url: "/",
        async: false,
        data: item,
        dataType: 'json',
        type:"post",

        success: function(data) {


            resultAjax =  data
        },
        error: function(data) {
            resultAjax =  'error'
            new Noty({
                theme: 'relax',
                timeout: 2000,
                layout: 'topCenter',
                type: "warning",
                text: "Ошибка передачи данных"
            }).show();
        }

    });

    return resultAjax
}


